import React from 'react';
import ReactDOM from 'react-dom/client';
import './style.scss';
import reportWebVitals from './reportWebVitals';



function Quiz() {
  return (
    <div className="quiz-app">
      <h1>Bubba</h1>
      <ul>Яке місто є столицею України?
        <li>Київ</li>
        <li>Анкара</li>
        <li>Хокайдо</li>
        <li>Янґон</li>
      </ul>
      <ul>Де живе Ілон Маск?
        <li>В Преторії</li>
        <li>В Лос-Анджелесі</li>
        <li>В Полтаві</li>
        <li>В Вінніпезі</li>
      </ul>
      <ul>Де вперше було помічено спалах коронавірусу?
        <li>у місті Бидгощ, Польща</li>
        <li>у місті Нью-Йорк, США</li>
        <li>у місті Усурійськ, РФ</li>
        <li>у місці Ухань, КНР</li>
      </ul>
      <ul>Коли було зафіксовано перший спалах коронавірусу?
        <li> Початок 2019-го року</li>
        <li> Кінець 2019-го року</li>
        <li>Початок 2020-го року</li>
        <li>Кінець 2020-го року</li>
      </ul>
      <ul>Яка страва є традиційною на День подяки в США?
        <li>Морозиво</li>
        <li>Індичка</li>
        <li>Торт</li>
        <li>Рисове рагу</li>
      </ul>
    </div>
  );
}
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Quiz />
  </React.StrictMode>
);

